import React from 'react'
import { Button, Card, Col, Container, Row } from 'react-bootstrap'
import Pagina from '../components/Pagina'

const carros = () => {

    const carros = [
        { marca: 'Honda', modelo: 'Civic', ano: 2015, cor: 'branco', foto: 'data:image/jpeg;base64,' },
        { marca: 'Hyundai', modelo: 'Tucson', ano: 2012, cor: 'preto', foto: 'data:image/jpeg;base64,' },
        { marca: 'Chevrolet', modelo: 'Celta', ano: 2002, cor: 'vermelho', foto: 'data:image/jpeg;base64,' },
        { marca: 'Fiat', modelo: 'Tempra', ano: 2000, cor: 'vinho', foto: 'data:image/jpeg;base64,' },
        { marca: 'Fiat', modelo: 'Marea', ano: 2001, cor: 'prata', foto: 'data:image/jpeg;base64,' },
        { marca: 'Fiat', modelo: 'Doblo', ano: 2010, cor: 'branco', foto: 'data:image/jpeg;base64,' },
    ]

    return (
        <Pagina titulo="Carros">

            <Row md={3}>
                {carros.map(item => (
                    <Col>
                        <Card className="mb-3">
                            <Card.Img variant="top" src={item.foto} />
                            <Card.Body>
                                <Card.Title>{item.marca} - {item.modelo}</Card.Title>
                                <p>Ano: {item.ano}</p>
                                <p>Cor: {item.cor}</p>
                                <Button variant="danger">Detalhes</Button>
                            </Card.Body>
                        </Card>
                    </Col>
                ))}
            </Row>

        </Pagina>
    )
}

export default carros




